function SimpleArray() {
  let fruits = ["Apple", "Mango", "Grapes", "Orange"];
  return (
    <div>
      <h2>Fruits list:- </h2>
      <ul>
        {fruits.map((fruits, index) => (
          <li key={index}>{fruits}</li>
        ))}
      </ul>
    </div>
  );
}

