// Date formatter component
function DateFormatter(props) {
  return (
    <div>
      <p>
        <b>Date: </b>
        {props.date.toLocaleDateString()}
      </p>
    </div>
  );
}
// Author component

function Author(props) {
  return (
    <div>
      <img src={props.profile.imageUrl} width="100" height="100" />
      <p>
        <b>Author: </b>
        <i>{props.profile.name}</i>
      </p>
    </div>
  );
}

function Comment(props) {
  return (
    <div>
      <Author profile={props.profile} />
      <p>
        <b>Comment: </b>
        {props.text}
      </p>
      <p>
        <b>Likes: </b>
        {props.likes}
      </p>
      <DateFormatter date={props.date} />
    </div>
  );
}

